import './style.css';

interface Props{

}



const InputBox=forwardRef<HTMLIFrameElement,Props>((props:Props,ref)=>{




    return(

        <div className='InputBox'>
                <div className='InputBox-Label'>{'비밀번호*'}</div>
                <div className='InputBox-Container'>
                            <input className='Input'/>
                            <div className='Icon-Botton'>
                                        <div className='Icon eye-light-off-icon'></div>
                            </div>
                </div>
                <div className='InputBox-Message'>{'비밀번호는 8자 이상 입력해주세요'}</div>
        </div>



          )


});



export default InputBox;
